sourcesContent:
export default {
  "title": "AML",
  "tagline": "Standards and tools to define, parse and link metadata",
  "url": "https://aml-org.github.io",
  "baseUrl": "/",
  "organizationName": "aml-org",
  "projectName": "amf-documentation",
  "scripts": [
    "https://buttons.github.io/buttons.js"
  ],
  "favicon": "img/logos/amlLogo.svg",
  "customFields": {},
  "onBrokenLinks": "log",
  "onBrokenMarkdownLinks": "log",
  "plugins": [
    "docusaurus-plugin-sass"
  ],
  "presets": [
    [
      "@docusaurus/preset-classic",
      {
        "docs": {
          "showLastUpdateAuthor": true,
          "showLastUpdateTime": true,
          "path": "../docs",
          "sidebarPath": "./sidebars.js"
        },
        "theme": {
          "customCss": "../src/css/custom.scss"
        },
        "blog": false
      }
    ]
  ],
  "themeConfig": {
    "prism": {
      "additionalLanguages": [
        "scala",
        "java"
      ],
      "defaultLanguage": "java",
      "theme": {
        "plain": {
          "color": "#393A34",
          "backgroundColor": "#f6f8fa"
        },
        "styles": [
          {
            "types": [
              "comment",
              "prolog",
              "doctype",
              "cdata"
            ],
            "style": {
              "color": "#999988",
              "fontStyle": "italic"
            }
          },
          {
            "types": [
              "namespace"
            ],
            "style": {
              "opacity": 0.7
            }
          },
          {
            "types": [
              "string",
              "attr-value"
            ],
            "style": {
              "color": "#e3116c"
            }
          },
          {
            "types": [
              "punctuation",
              "operator"
            ],
            "style": {
              "color": "#393A34"
            }
          },
          {
            "types": [
              "entity",
              "url",
              "symbol",
              "number",
              "boolean",
              "variable",
              "constant",
              "property",
              "regex",
              "inserted"
            ],
            "style": {
              "color": "#36acaa"
            }
          },
          {
            "types": [
              "atrule",
              "keyword",
              "attr-name",
              "selector"
            ],
            "style": {
              "color": "#00a4db"
            }
          },
          {
            "types": [
              "function",
              "deleted",
              "tag"
            ],
            "style": {
              "color": "#d73a49"
            }
          },
          {
            "types": [
              "function-variable"
            ],
            "style": {
              "color": "#6f42c1"
            }
          },
          {
            "types": [
              "tag",
              "selector",
              "keyword"
            ],
            "style": {
              "color": "#00009f"
            }
          }
        ]
      },
      "darkTheme": {
        "plain": {
          "color": "#F8F8F2",
          "backgroundColor": "#282A36"
        },
        "styles": [
          {
            "types": [
              "prolog",
              "constant",
              "builtin"
            ],
            "style": {
              "color": "rgb(189, 147, 249)"
            }
          },
          {
            "types": [
              "inserted",
              "function"
            ],
            "style": {
              "color": "rgb(80, 250, 123)"
            }
          },
          {
            "types": [
              "deleted"
            ],
            "style": {
              "color": "rgb(255, 85, 85)"
            }
          },
          {
            "types": [
              "changed"
            ],
            "style": {
              "color": "rgb(255, 184, 108)"
            }
          },
          {
            "types": [
              "punctuation",
              "symbol"
            ],
            "style": {
              "color": "rgb(248, 248, 242)"
            }
          },
          {
            "types": [
              "string",
              "char",
              "tag",
              "selector"
            ],
            "style": {
              "color": "rgb(255, 121, 198)"
            }
          },
          {
            "types": [
              "keyword",
              "variable"
            ],
            "style": {
              "color": "rgb(189, 147, 249)",
              "fontStyle": "italic"
            }
          },
          {
            "types": [
              "comment"
            ],
            "style": {
              "color": "rgb(98, 114, 164)"
            }
          },
          {
            "types": [
              "attr-name"
            ],
            "style": {
              "color": "rgb(241, 250, 140)"
            }
          }
        ]
      }
    },
    "navbar": {
      "title": "",
      "logo": {
        "src": "img/logos/amlLogo.svg",
        "alt": "AML logo icon"
      },
      "items": [
        {
          "to": "docs/aml",
          "label": "AML",
          "position": "left"
        },
        {
          "to": "docs/AMF/amf_intro",
          "label": "AMF",
          "position": "left"
        },
        {
          "href": "https://www.npmjs.com/package/amf-client-js",
          "className": "header-npm-link",
          "aria-label": "npm link",
          "position": "right"
        },
        {
          "href": "https://github.com/aml-org/amf",
          "className": "header-github-link",
          "aria-label": "GitHub repository",
          "position": "right"
        }
      ],
      "hideOnScroll": false
    },
    "footer": {
      "style": "dark",
      "links": [
        {
          "title": "Docs",
          "items": [
            {
              "label": "Get Started",
              "to": "/docs/aml"
            }
          ]
        },
        {
          "title": "Resources",
          "items": [
            {
              "label": "AML",
              "href": "https://github.com/aml-org/amf-aml"
            },
            {
              "label": "AML Spec",
              "href": "https://github.com/aml-org/aml-spec"
            },
            {
              "label": "AMF",
              "href": "https://github.com/aml-org/amf"
            }
          ]
        }
      ],
      "copyright": "Copyright Â© 2021 Mulesoft, LLC, a Salesforce company",
      "logo": {
        "src": "img/logos/amlLogo.svg"
      }
    },
    "colorMode": {
      "defaultMode": "light",
      "disableSwitch": false,
      "respectPrefersColorScheme": false,
      "switchConfig": {
        "darkIcon": "ðŸŒœ",
        "darkIconStyle": {},
        "lightIcon": "ðŸŒž",
        "lightIconStyle": {}
      }
    },
    "docs": {
      "versionPersistence": "localStorage"
    },
    "metadatas": [],
    "hideableSidebar": false
  },
  "baseUrlIssueBanner": true,
  "i18n": {
    "defaultLocale": "en",
    "locales": [
      "en"
    ],
    "localeConfigs": {}
  },
  "onDuplicateRoutes": "warn",
  "themes": [],
  "titleDelimiter": "|",
  "noIndex": false
};
